$(window).load(function(){
	// Journals page sidebar sticky
	if($('.pz-stick-in-parent').length && $(window).width() > 768){
		$('.pz-stick-in-parent').stick_in_parent({
			parent: "body",
			offset_top: 59,
			inner_scrolling: true
		});
	}
});

$(window).scroll(function(){
	var scTop = $(this).scrollTop();
	if(scTop > 300){
		$('body').addClass('scrolled');
	}else{
		$('body').removeClass('scrolled');
	}
});

$(document).ready(function() {
	if($('.pz-side-tab').length){
		$('body').on('click','.pz-side-tab', function(){
			$(this).closest('.row').find('.pz-side-info').toggleClass('pz-side-expanded');
		});
	}

	// Tooltips for download icons on article page
	if($('.pz-article-download-icons').length){
		$('.pz-article-download-icons a[data-toggle="tooltip"]').tooltip({ placement: 'bottom' });
	}
	// Disciplines Instant Search
	$('body').on('keyup input propertychange','#byDisciplineInstantSearch', function(){
		var qry = $(this).val().toLowerCase();
		var $journalBoys = $('#fullJournalBoys');
		if(qry.length){
			$journalBoys.find('.journal-list-search-item').each(function(){
				var $this = $(this);
				var jboxcontent = $(this).text().toLowerCase();
				if(jboxcontent.indexOf(qry) > -1){
					$this.removeClass('hide');
				}else{
					$this.addClass('hide');
				}
			});
		}else{
			$journalBoys.find('.journal-list-search-item').removeClass('hide');
		}
	});

	// Back to top
	$('body').on('click','#backToTop', function(){
		$('body,html').animate({scrollTop: 0}, 500);
	});
	$('body').on('keyup input propertychange','.pz-instant-search', function(){
		var $targetArticles = $('#allArticles .pz-article-box');
		var q = $(this).val().toLowerCase();
		if($targetArticles.length){
			if(q.length){
				$targetArticles.each(function(){
					var aTitle = $(this).text().toLowerCase();
					if(aTitle.indexOf(q) > -1){
						$(this).show();
					}else{
						$(this).hide();
					}
				});
			}else{
				$targetArticles.show();
			}
		}
	});

	// Articles homepage Data Table
	if($('#articlesTable').length){
		$('#articlesTable').DataTable({
			"pageLength": 5,
			"dom": 't<"pz-pagination"p><"clear">'
		});
	}

	$("#testimonials-carousal").owlCarousel({
		navigation : false,
		autoPlay: 3000,
		singleItem: true,
		autoHeight: true
	});
	$('.owl-carousel-ad').owlCarousel({
		loop: true,
		autoPlay: 3000,
		margin: 10,
		nav: true,
		singleItem: true,
		autoHeight: true
	})
	$('#searchModal').on('shown.bs.modal', function(){
		$('#pz-search-form').focus().select();
	});

	$("#owl-journal-carousel").owlCarousel({
		autoPlay:true,
		items: 6,
		itemsDesktop: [1170,6],
		itemsDesktopSmall: [970,4],
		itemsMobile: [470,2]
	});

	$("#ebmembersCarousel").owlCarousel({
		autoPlay:true,
		items: 3,
		itemsDesktop: [1170,3],
		itemsDesktopSmall: [970,3],
		itemsMobile: [470,1]
	});

	$('.pz-main-navbar .dropdown-menu *').click(function(e) {
		e.stopPropagation();
	});

	$('body').on('show.bs.modal','#memberBioModal', function(e){
		var $member = $(e.relatedTarget).closest('.pz-member');
		var memberName = $member.find('.pz-member-name').text().length ? $member.find('.pz-member-name').text() : '';
		var memberDesi = $member.find('.pz-member-desigation').text().length ? $member.find('.pz-member-desigation').text() : '';
		var memberDept = $member.find('.pz-member-department').text().length ? $member.find('.pz-member-department').text() : '';
		var memberUniv = $member.find('.pz-member-university').text().length ? $member.find('.pz-member-university').text() : '';
		var memberCoun = $member.find('.pz-member-country').text().length ? $member.find('.pz-member-country').text() : '';
		var memberEmail = $member.find('.pz-member-email').text().length ? $member.find('.pz-member-email').text() : '';
		var memberJour = $member.find('.pz-member-journal').text().length ? $member.find('.pz-member-journal').text() : '';
		var memberBiog = $member.find('.pz-member-biography').text().length ? $member.find('.pz-member-biography').text() : '';
		var memImageStyle = $member.find('.pz-member-image').attr('style');
		// var memberImageURL = memBG.replace('url(','').replace(')','').replace(/\"/gi, "");

		var $modal = $(e.target);
		$modal.find('.pz-member-big-name').text(memberName);
		$modal.find('.pz-member-big-designation').text(memberDesi);
		$modal.find('.pz-member-big-department').text(memberDept);
		$modal.find('.pz-member-big-university').text(memberUniv);
		$modal.find('.pz-member-big-country').text(memberCoun);
		$modal.find('.pz-member-big-email').text(memberEmail);
		$modal.find('.pz-member-big-journal').text(memberJour);
		$modal.find('.pz-member-big-biography').text(memberBiog);
		$modal.find('.pz-member-big-image').attr('style',memImageStyle);
		// $modal.find('.pz-member-big-image').css('background-image','url('+memberImageURL+');');
	});
});

